import React from "react";
import {NavLink} from "react-router-dom";

const Navbar=()=>{
    return(
        <>
        <div className="navbarr " >
    <div className="nav-1">
        <h1>Rishav <strong className="caste">Sachdeva</strong></h1>
    </div>
    <div>
        <ul  className="nav-2">
        <NavLink className="nav-elements"  style={isActive => ({
         color: isActive ? "green" : "blue"
      })}  exact to="/">Home</NavLink>
      
            <NavLink activeClassName="nav-active" className="nav-elements"  exact to="/about">About Me</NavLink>
            <NavLink activeClassName="nav-active" className="nav-elements" exact to='/certificates'>Certifications</NavLink>
            <NavLink activeClassName="nav-active" className="nav-elements" exact to='/skills'>Skills</NavLink>
        </ul>
    </div>
</div>
        
        </>
    );
}
export default Navbar;
